import React from 'react';
import ListItem from './task-list-item';

const TaskList = ({ data }) => {
    const items = data.map((item) => {
        return (
            <li >
                <ListItem { ...item} />
            </li>
        );
    });

    return (
        <ul>
            {items}
        </ul>
    );
};

export default TaskList;
